import React from "react";
import style from "./NavBar.module.css";

function NavBar() {
  return (
    <div className={style.nav}>
        <ul>
            
        </ul>
      <li>My Server</li>
      <li>Recommended</li>
      <li>NA Server</li>
    </div>
  );
}

export default NavBar;
